import Footer from './Components/Footer';
import Header from './Components/Header';
import faker from 'faker'

function App() {
  return (
    <div>
      <Header />
      JUma 
      <div className="m-1 w-full  bg-cover bg-fixed bg-no-repeat">
        <img src = {faker.image.image()} alt="back"/>
      </div>
        <Footer />
    </div>
  );
}

export default App;
